import React from 'react'

const Ownitem = ({ownPost}) => {
    return (
        <div className="col-12 m-4 post-box">
            <div className="col-2" style={{padding:'10px'}}>{ownPost.post_title}</div>
        </div>
    )
}

export default Ownitem
